import React, { Component } from 'react'
import {
    Header,
    Container
} from 'semantic-ui-react';

const Head = ()=>(
    
    <Container text>
        <Segment
            inverted
            textAlign='center'
            style={{ minHeight: 500, padding: '4em 0em' }}
            vertical
          >
         <Header
      as='h1'
      content='Weather'
      inverted
      style={{
        fontSize:'4em',
        fontWeight: 'normal',
        marginBottom: 0,
        marginTop: '1.5em',
      }}
    />
    </Segment>
    </Container>
)

export default Head
